import { makeStyles } from "@mui/styles";

const RegisterStyle = makeStyles({
    Box : {
        userSelect: "none",
        height: "80vh",
        display: "flex",
        flexDirection: "column",
        margin: "0 30vw 0 30vw",
        justifyContent: "center",
        alignItems: "center",
        gap: "1rem",
        border: "solid"
    }
})

export default RegisterStyle
